import{_ as a,c as e,o as t,at as r}from"./chunks/framework.DlVNm9e8.js";const b=JSON.parse('{"title":"2024汇总","description":"","frontmatter":{"date":"2024-12-21T01:05:36.000Z","http://localhost:3011/1734717993249.jpg":"https://file.fishpi.cn/2024/12/image-0664db9d.png","articleTitle":"【猫转身】2024汇总","articleId":1734718163832,"articleTags":"2024年终总结","post2vitepress":true},"headers":[],"relativePath":"posts/【猫转身】2024汇总.md","filePath":"posts/【猫转身】2024汇总.md"}'),o={name:"posts/【猫转身】2024汇总.md"},l=r('<h1 id="_2024汇总" tabindex="-1">2024汇总 <a class="header-anchor" href="#_2024汇总" aria-label="Permalink to &quot;2024汇总&quot;">​</a></h1><p>回头看看其实我一年做的事情不多，对比一下其实我的工作生活并不出彩，没有很多的旅游外出和人际交往，大多两点一线加打游戏看书写代码，而且我完成一个阶段的事情会留帖子，所以一年做了啥有意义的事儿可能几张帖子就已经说完了。与其做总结不如做个温习看看我今年做了什么以及他们给我的感受。</p><p>2024年发帖列表（按时间顺序）：</p><p><a href="https://fishpi.cn/article/1704163545466" target="_blank" rel="noreferrer">startnode log module(已废弃）</a><a href="https://fishpi.cn/article/1707219341962" target="_blank" rel="noreferrer">startnode voice io module(已废弃）</a><a href="https://fishpi.cn/article/1708934562888" target="_blank" rel="noreferrer">startnode task list module(已废弃）</a><a href="https://fishpi.cn/article/1711904284797" target="_blank" rel="noreferrer">烟台出差</a><a href="https://fishpi.cn/article/1713080276176" target="_blank" rel="noreferrer">vscode语言插件</a><a href="https://fishpi.cn/article/1731741593195" target="_blank" rel="noreferrer">catbox</a><a href="https://fishpi.cn/article/1732638685174" target="_blank" rel="noreferrer">扩充电脑桌面</a></p><h2 id="_1-startnode-已废弃" tabindex="-1">1.startnode（已废弃） <a class="header-anchor" href="#_1-startnode-已废弃" aria-label="Permalink to &quot;1.startnode（已废弃）&quot;">​</a></h2><p>这是一个年初我想写一个工作站来着，一个日志记录的工具，有一个web和node后端服务，写着写着觉得太散不靠谱，写的感觉很差劲儿，刚好那段时间换了工作，遂放弃写下去，不过中途还是略有收获，这也是后面vscode语言插件的伏笔。</p><h2 id="_2-烟台出差" tabindex="-1">2.烟台出差 <a class="header-anchor" href="#_2-烟台出差" aria-label="Permalink to &quot;2.烟台出差&quot;">​</a></h2><p>出差断断续续持续半年，乘坐了人生第一次飞机，看到了烟台这边的大海，吃了一些鲁菜，带了海参给爸妈吃。虽然出差这个过程很累，但是接触到新地方也增长了视野，工作上也获取了很多新知识，学会一点点react，可以说收获不浅~</p><p>不过长期的出差导致我6 7 8三个月份基本没有额外产出（没有写自己的代码）...</p><h2 id="_3-vocode语音插件" tabindex="-1">3.vocode语音插件 <a class="header-anchor" href="#_3-vocode语音插件" aria-label="Permalink to &quot;3.vocode语音插件&quot;">​</a></h2><p>这是出差同期写的，在项目不紧急的时候写着玩的。当时还想着用它助力我写博客或者记录啥的，结果到最后还是不如鼠标键盘，因为反应速度太慢，可操作性很差，要说唯一的应用场景可能是帮助手部残障人士写代码吧？ 为什么我要是写出这种感觉有用但实际用不了一点的东西啊 笑~</p><h2 id="_4-catbox" tabindex="-1">4.catbox <a class="header-anchor" href="#_4-catbox" aria-label="Permalink to &quot;4.catbox&quot;">​</a></h2><p>catbox是一个windows的桌面软件，是我用来替代startnode的，用electron写的（也是学习electron的一种方式，中途踩了很多坑），集合了node和前端框架，可以说是nodestart的升级版。写这个最大的目的是本地写好的md文件快速方便的同步到鱼排，目前拓展到协助维护我的博客发布。 这个东西从九月写到十二月，这篇文章就是用catbox写的。当然期间沉迷游戏所以拖延了很久。</p><h2 id="_5-扩充电脑桌面" tabindex="-1">5.扩充电脑桌面 <a class="header-anchor" href="#_5-扩充电脑桌面" aria-label="Permalink to &quot;5.扩充电脑桌面&quot;">​</a></h2><p>对老的电脑桌进行了一些改造，主要是扩展面积能让我放笔记本，pad，手柄等玩意而不拥挤，我只能说物有所值（大桌用着好爽），就是那个副屏感觉没那么好用（闲置率较高），但也谈不上鸡肋，敲代码的话还是好用的。</p><h2 id="_6-其他" tabindex="-1">6.其他 <a class="header-anchor" href="#_6-其他" aria-label="Permalink to &quot;6.其他&quot;">​</a></h2><ul><li>其实中途我还改造了之前写的博客，主要是页面内容和样式，老的没有移动端适配很烦，重写了很多吧，还在慢慢补充中...</li><li>11月12月比较清闲，爽玩了文明六和mc，12月甚至连着2周天天工作日6小时打游戏，真是令人感到堕落呢！ mc主要就是新服，刚好时间合适，弥补了我学生时代想玩但是没人陪我玩的遗憾，如果你有时间，看看我做的樱花桥和钓鱼房吧~</li></ul><p><img src="http://localhost:3011/1734717993249.jpg" alt="1734717993250"> 希望有更多鱼油一起玩！</p><ul><li>catbox的软著申请由于文件格式不规范被打回来了，可恶啊希望下次能过！</li><li>vscode语音插件竟然还被鱼油拿去交作业，问我怎么部署（抱歉我是鸽子咕咕咕）我真的很好奇啥作业是交插件上去的？？？</li><li>偷懒练习科目二，进度缓慢，但憧憬买车中...</li><li>每天和鱼油在群里吹水鉴史也是调剂苦闷工作的咖啡因，不过聊天室确实很少来了，我不喜欢庞杂的机器人指令，转为潜水作业。</li></ul><p>以上。</p><h2 id="and" tabindex="-1">and... <a class="header-anchor" href="#and" aria-label="Permalink to &quot;and...&quot;">​</a></h2><p>我给自己的目标一直是尽量做自己想做的事情，以及把需要做的事情做好一点点，我也一直向这个方向努力着。</p><p>好好活着就是做有意义的事情，做有意义的事情就是好好活着。</p><p>想做的事情很多，能做的事情很少，但我享受着这种未完全满足灼热感，这是仅有的驱使我慢慢前进的动力。</p><p>最后给看的你点一首《恭喜你发财》</p>',25),i=[l];function n(s,c,h,d,p,_){return t(),e("div",null,i)}const u=a(o,[["render",n]]);export{b as __pageData,u as default};
